import React from 'react';
import _ from 'lodash';
import * as assets from '../assets';
import { Navbar } from '../components';
import { Box, Button, Flex, HStack, Image, Link, Text, VStack } from "@chakra-ui/react";

interface NFTInfo {
  creator: string; title: string; imageUrl: string; price: string;
}

const NFT_CARD_ROW_BATCH_SIZE = 3;

export const MainPage = () => {
  return (
    <div className="App" style={{ alignItems: 'center' }}>
      <Navbar withSearchBar={true} />
      <Flex alignItems="center" justifyContent="center" width="100%" height="50%" marginTop="40px" padding="0px 36px">
        <MarketplaceHeader />
      </Flex>
      <Flex alignItems="center" justifyContent="center" margin="40px 0px" padding="0px 36px">
        <VStack spacing={12}>
          <Text fontSize="3xl" fontWeight="bold">Latest NFTs</Text>
          {_.range(0, nfts.length, NFT_CARD_ROW_BATCH_SIZE).map((i) => <NFTsCardRow nftInfoForRow={nfts.slice(i, i + NFT_CARD_ROW_BATCH_SIZE)} />)}
        </VStack>
      </Flex>
    </div>
  );
}

const NFTsCardRow = ({ nftInfoForRow }: { nftInfoForRow: Array<NFTInfo>}) => {
  return (
    <HStack spacing={16}>
      {nftInfoForRow.map((nftInfo: NFTInfo) => <NFTCard creator={nftInfo.creator} title={nftInfo.title} imageUrl={nftInfo.imageUrl} price={nftInfo.price} />)}
    </HStack>
  )
}

const NFTCard = ({ creator, title, imageUrl, price }: NFTInfo) => {
  return (
    <Box maxW="sm" borderWidth="1px" borderRadius="lg" overflow="hidden">
      <Image src={imageUrl} h={64} w={72} />

      <Box p="6">
      <Box
            color="gray.500"
            fontWeight="semibold"
            letterSpacing="wide"
            fontSize="xs"
            textTransform="uppercase"
          >
            {creator}
          </Box>

        <Flex alignItems="center" justifyContent="space-between">
          <Box
            fontWeight="semibold"
            as="h4"
            isTruncated
          >
            {title}
          </Box>

          <Box>
            {price}
          </Box>
        </Flex>
      </Box>
    </Box>
  )
}

const MarketplaceHeader = () => {
  return (
    <Box
        pos="relative"
        w="100%"
        h="400"
        bgImage={assets.moonEarthRocketImage}
        bgSize="cover"
        bgPosition="60% center"
        borderRadius="12px"
      >
        <Flex flexDirection="column" alignItems="center" justifyContent="center" height="100%">
          <VStack spacing={4}>
            <Text fontSize="4xl" fontWeight="bold" color="white">Welcome to OpenSpace</Text>
            <Text fontSize="1xl" fontWeight="bold" color="orange.400">The latest NFT marketplace built on top of Flow</Text>
            <HStack>
              <Button
                  display={{ base: 'none', md: 'inline-flex' }}
                  fontSize={'sm'}
                  fontWeight={600}
                  color={'white'}
                  bg={'blue.400'}
                  _hover={{
                    bg: 'blue.300',
                  }}>
                  <Link href="https://www.onflow.org/" isExternal style={{ textDecoration: 'none' }}>About Flow</Link>
                </Button>
              <Button
                  display={{ base: 'none', md: 'inline-flex' }}
                  fontSize={'sm'}
                  fontWeight={600}
                  color={'blue.400'}
                  bg={'white'}
                  outline="1px solid"
                  outlineColor={'blue.400'}
                  >
                  <Link href="#" style={{ textDecoration: 'none' }}>Create</Link>
                </Button>
              </HStack>
          </VStack>        
          </Flex>
      </Box>
  )
}

